import React, { useState } from "react";
import "./Menu.css";

const Menu = ({ titleText, openCloseMenu }) => {
  return (
    <div className="menu">
      <div className="line">CATEGORIES</div>
      <div className="section">Poultry</div>
    </div>
  );
};

export default Menu;
